import React, { Component } from 'react';
import './Header.css';



class Header extends Component {
  render() {
    return (
      <div className="header-options">
        <div className="menu-buttons">
            <button className="recipes-button">Recipes</button>
            <button className="about-button">About</button>
            <button className="Newsletter-button">Newsletter</button>
            <button className="blizard-button blizzard-option">Blizzards</button>
            <button className="coupon-button">Coupons</button>
            <button className="contact-button">Contact</button>
            <button className="register-button">Register</button>
            <button className="login-button">Log-In</button>


        </div>

      </div>
    );
  }
}

export default Header;
